Secrets of Selfridges

History Documentary hosted by Samuel West, published by PBS broadcasted as part of PBS Secrets series in 2013 - English narration


Information
------------------------------

Two words are synonymous with Selfridges: luxury and London. However, Selfridges was the brain child of an American-Mr. Harry Gordon Selfridge-whose life is depicted in the current MASTERPIECE miniseries Mr. Selfridge. The real, flamboyant Mr. Selfridge brought about a complete revolution in the way that Londoners shopped, introducing a new American retail model which made shopping less of a practical pursuit and more of a luxurious adventure. But there was another one side to the story - Harry's private life. When it began to seep into his business, the effect on him and his store was devastating.

